  return (
    <div className="App">
      <header className="App-header">
        <h1>AI 婚纱摄影应用</h1>
      </header>
      <DemoDisplay />
      <UploadTool />
      <VlogDisplay />
      {/* 这里将来会添加模块内容 */}
    </div>
  );
}

export default App;
